import Button from "./Button";
import './App.css';

const data = [
  {
    name: "Click Me"
  },
  {
    name: "Me Too"
  },
  {
    name: "Me Three"
  },
  {
    name: "Don't Click me"
  }
]

const bodyColor={
"backgroundColor":"red"
}

function App() {
  return (
    <div className="App" style={bodyColor}>
      <p>Randomize Color</p>
      {
        data.map((val) => {
          return (<Button name={val.name} />)
        })
      }
    </div>
  );
}

export default App;
